import React, { Component } from 'react'
import Header from '../components/Header';
import Sidebar from '../components/Sidebar';

class Home extends Component {
  render() {
    return (
      <>
      <Header />
      <main>
        <Sidebar />
        <Content>
          <h1>HOME</h1>
        </Content>
      </main>
      </>
    )
  }
}

export default Home;
